import React, { useState } from 'react';
import axios from 'axios';
import { TextField, Button, Container, Typography, Box, CircularProgress } from '@mui/material';
import DataTable from './DataTable';
import ScatterPlot from './ScatterPlot';

const MainComponent = () => {
    const [keywords, setKeywords] = useState('');
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(false);

    const handleKeywordsChange = (event) => {
        setKeywords(event.target.value);
        console.log('Keywords changed:', event.target.value);
    };

    const handleFetchData = async () => {
        setLoading(true);
        setData([]);
        console.log('Fetching data for keywords:', keywords);

        const apiKey = process.env.REACT_APP_JUNGLE_SCOUT_API_KEY;
        const keyName = process.env.REACT_APP_JUNGLE_SCOUT_KEY_NAME;
        const url = "https://developer.junglescout.com/api/product_database_query?marketplace=us";

        const headers = {
            'Authorization': `${keyName}:${apiKey}`,
            'X-API-Type': 'junglescout',
            'Accept': 'application/vnd.junglescout.v1+json',
            'Content-Type': 'application/vnd.api+json',
        };

        const keywordList = keywords.split(',').map(keyword => keyword.trim());

        let allResults = [];

        for (const keyword of keywordList) {
            const payload = {
                data: {
                    type: "product_database_query",
                    attributes: {
                        include_keywords: [keyword],
                        exclude_unavailable_products: true
                    }
                }
            };

            try {
                const response = await axios.post(url, payload, { headers });

                console.log('API response received:', response);

                if (response.data && response.data.data) {
                    const results = response.data.data.map(item => ({
                        asin: item.id.replace('us/', ''),
                        title: item.attributes.title,
                        brand: item.attributes.brand,
                        price: item.attributes.price,
                        reviews: Math.round(item.attributes.reviews),
                        rating: item.attributes.rating,
                        category: item.attributes.category,
                        sales: item.attributes.approximate_30_day_units_sold,
                        percentOfTotalSales: 0, // Placeholder for now
                        revenue: item.attributes.approximate_30_day_revenue,
                        percentOfTotalRevenue: 0, // Placeholder for now
                        imageUrl: item.attributes.image_url,
                        sellerType: item.attributes.seller_type,
                        dateFirstAvailable: item.attributes.date_first_available,
                    }));

                    allResults = [...allResults, ...results];
                } else {
                    console.error('Invalid response format:', response);
                }
            } catch (error) {
                console.error("API request failed:", error.response ? error.response.data : error.message);
                if (error.response) {
                    console.error("Error data:", error.response.data);
                    console.error("Error status:", error.response.status);
                    console.error("Error headers:", error.response.headers);
                }
            }
        }

        // Calculate total sales and revenue
        const totalSales = allResults.reduce((sum, item) => sum + item.sales, 0);
        const totalRevenue = allResults.reduce((sum, item) => sum + item.revenue, 0);

        // Add percentage of total sales and revenue to each item
        allResults = allResults.map(item => ({
            ...item,
            percentOfTotalSales: ((item.sales / totalSales) * 100).toFixed(2) + '%',
            percentOfTotalRevenue: ((item.revenue / totalRevenue) * 100).toFixed(2) + '%'
        }));

        // Sort the results by sales in descending order
        allResults.sort((a, b) => b.sales - a.sales);

        // Calculate summary data
        const averagePrice = (allResults.reduce((sum, item) => sum + item.price, 0) / allResults.length).toFixed(2);
        const averageReviews = (allResults.reduce((sum, item) => sum + item.reviews, 0) / allResults.length).toFixed(0);

        const summaryData = {
            asin: "Summary",
            title: "Summary",
            brand: "",
            price: averagePrice,
            reviews: averageReviews,
            rating: "",
            category: "",
            sales: totalSales,
            percentOfTotalSales: "100%",
            revenue: totalRevenue,
            percentOfTotalRevenue: "100%",
            imageUrl: "",
            sellerType: "",
            dateFirstAvailable: "",
        };

        setData([summaryData, ...allResults]);
        setLoading(false);
    };

    return (
        <Container>
            <Box my={4}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Jungle Scout Product Explorer
                </Typography>
                <Box display="flex" alignItems="center" mb={2}>
                    <TextField
                        label="Enter keywords separated by commas"
                        variant="outlined"
                        fullWidth
                        value={keywords}
                        onChange={handleKeywordsChange}
                        style={{ marginRight: 10 }}
                    />
                    <Button variant="contained" color="primary" onClick={handleFetchData} disabled={loading}>
                        {loading ? <CircularProgress size={24} /> : 'Fetch Data'}
                    </Button>
                </Box>
                {data.length > 1 && <ScatterPlot data={data.slice(1)} />}
                <DataTable data={data} />
            </Box>
        </Container>
    );
};

export default MainComponent;
